import React from "react";
import "./MultiUser.css";
import { getHandles } from "./util";

function MultiUser() {
  const urlArray = window.location.href;

  const handles = getHandles(urlArray);

  console.log(handles);

  return (
    <div className="multi">
      <h1>I am MultiUser</h1>
    </div>
  );
}

export default MultiUser;
